(1, 18, 'select \n	0 AS ROWCHK,VALIDSEQ,PJTSEQ,VALIDID,VALIDNM\n	,VALIDORD,VALIDTYPE,INVALIDMSG,MATSTR\n	,ADDDT,MODDT\nfrom CG_VALID\nwhere PJTSEQ = ?', 'select \n	0 AS ROWCHK,VALIDSEQ,PJTSEQ,VALIDID,VALIDNM\n	,VALIDORD,VALIDTYPE,INVALIDMSG,MATSTR\n	,ADDDT,MODDT\nfrom CG_VALID\nwhere PJTSEQ = \'3\'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20180313102908'),
(2, 36, 'select \n	USR_SEQ, USR_ID, USR_NM, \'--hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, USE_YN, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_ID like if(?=\'\',\'%\',?)', 'select \n	USR_SEQ, USR_ID, USR_NM, \'--hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, USE_YN, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_ID like if(\'\'=\'\',\'%\',\'\')', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20180313105532'),
(3, 37, 'select \n	USR_SEQ, USR_ID, USR_NM, \'--Hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_ID = ?\n', 'select \n	USR_SEQ, USR_ID, USR_NM, \'--Hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_ID = \'zero12a\'\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20180313105620'),
(4, 38, 'select \n	USR_SEQ, USR_ID, USR_NM, \'--Hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_ID = ?\n', 'select \n	USR_SEQ, USR_ID, USR_NM, \'--Hashed--\' as USR_PWD, PW_CHG_DT, PHONE\n	, PW_ERR_CNT, LAST_STATUS, ADD_DT, MOD_DT \nfrom CMN_USR \nwhere USR_ID = \'aa\'\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20180313105621');
